import { useEffect, useState } from "react";

function PhotoAlbum() {
  const [photos, setPhotos] = useState();

  useEffect(() => {
    fetch("https://api.pexels.com/v1/search?query=people", {
      headers: {
        Authorization:
          "563492ad6f91700001000001b7c4326e3e5f4db3aa90c6bc88e4aee7",
      },
    })
      .then((resp) => resp.json())
      .then((data) => {
        console.log(data);
        setPhotos(data.ph);
      });
  }, []);

  //   const renderPhotos = photos.photos?.map((photo) => {
  //     return (
  //       <div>
  //         <img src="{}" />
  //       </div>
  //     );
  //   });

  return (
    <div>
      <h3>Photos</h3>
    </div>
  );
}

export default PhotoAlbum;
